import{_ as t,c as e,o as r,ab as a}from"./chunks/framework.CUflZczI.js";const c=JSON.parse('{"title":"Симулятори, що підтримуються спільнотою","description":"","frontmatter":{},"headers":[],"relativePath":"uk/simulation/community_supported_simulators.md","filePath":"uk/simulation/community_supported_simulators.md"}'),o={name:"uk/simulation/community_supported_simulators.md"},s=a('<h1 id="симулятори-що-підтримуються-спільнотою" tabindex="-1">Симулятори, що підтримуються спільнотою <a class="header-anchor" href="#симулятори-що-підтримуються-спільнотою" aria-label="Permalink to &quot;Симулятори, що підтримуються спільнотою&quot;">​</a></h1><p>Цей розділ містить інформацію про симуляції, що <em>підтримуються спільнотою</em>.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>These simulators are not maintained, tested, or supported, by the core development team. They may or may not work with current versions of PX4.</p><p>Дивіться <a href="./../dev_setup/dev_env.html">Встановлення інструментарію</a> для інформації про середовища та інструменти, що підтримуються основною командою розробників.</p></div><p>Інструменти мають різний рівень підтримки своїми спільнотами (деякі добре підтримують, інші - ні). Питання про ці інструменти повинні порушуватися на <a href="./../contribute/support.html#forums-and-chat">форумах для обговорення</a></p><table><thead><tr><th>Симулятор</th><th>Опис</th></tr></thead><tbody><tr><td><a href="./../sim_flightgear/README.html">FlightGear</a></td><td><p>Симулятор який надає фізично та візуально реалістичні симуляції. Зокрема він може моделювати багато погодних умов, включаючи грози, сніг, дощ та град, а також може симулювати температурні режими та різні типи атмосферних течій. <a href="./../sim_flightgear/multi_vehicle.html">Симуляція кількох засобів</a> також підтримується.</p> <p><strong>Рухомі засоби, що підтримуються:</strong> Літак, Автожир, Ровер</p></td></tr><tr><td><a href="./../sim_jmavsim/">JMAVSim</a></td><td><p>A simple multirotor/quad simulator. This was previously part of the PX4 development toolchain but was removed in favour of <a href="./../sim_gazebo_gz/">Gazebo</a>.</p> <p><strong>Supported Vehicles:</strong> Quad</p></td></tr><tr><td><a href="./../sim_jsbsim/README.html">JSBSim</a></td><td><p>Симулятор, який надає моделі просунутої динаміки польоту. Він може використовуватися для моделювання реалістичної динаміки польоту, заснованої на даних з аеродинамічної труби.</p> <p><strong>Рухомі засоби, що підтримуються:</strong> Літак, Квадрокоптер, Гексакоптер</p></td></tr><tr><td><a href="./../sim_airsim/README.html">AirSim</a></td><td><p>Міжплатформовий симулятор який надає фізично та візуально реалістичні симуляції. Цей симулятор ресурсомісткий та потребує значно потужніший комп&#39;ютер ніж інші описані тут симулятори.</p><p><strong>Рухомі засоби, що підтримуються:</strong> Iris (модель мультиротора та налаштування для PX4 квадрокоптера в конфігурації &quot;X&quot;).</p></td></tr><tr><td><a href="./../sim_sih/README.html">Simulation-In-Hardware</a> (SIH)</td><td><p>Альтернатива симуляції HITL, яка пропонує важку симуляцію в реальному часі безпосередньо на обладнанні автопілота. Цей симулятор реалізований на C++ у вигляді модуля PX4 безпосередньо в <a href="https://github.com/PX4/PX4-Autopilot/tree/release/1.15/src/modules/simulator_sih" target="_blank" rel="noreferrer">коді</a> прошивки. </p><p><strong>Засоби, що підтримуються:</strong> Літак, Квадрокоптер, ВЗТП з хвоста</p></td></tr></tbody></table>',5),i=[s];function m(p,d,n,l,h,u){return r(),e("div",null,i)}const f=t(o,[["render",m]]);export{c as __pageData,f as default};
